import React, { useState } from "react";
import axios from "axios";
import './RankForm.css';

// Sample course data (Replace these with actual course data)
const iitCourses = ["Computer Science and Engineering", "Electrical Engineering", "Mechanical Engineering"];
const iiitCourses = ["Information Technology", "Electronics and Communication Engineering"];
const nitCourses = ["Civil Engineering", "Chemical Engineering", "Biotechnology"];

const RankForm = () => {
  const [instituteType, setInstituteType] = useState("");
  const [state, setState] = useState("");
  const [gender, setGender] = useState("");
  const [category, setCategory] = useState("");
  const [rank, setRank] = useState("");
  const [selectedCourses, setSelectedCourses] = useState([]);
  const [colleges, setColleges] = useState([]);

  const indianStates = ["Andhra Pradesh", "Assam", "Bihar", "Chhattisgarh", "Delhi", "Goa", "Gujarat"];

  const getCourses = () => {
    switch (instituteType) {
      case "iit": return iitCourses;
      case "iiit": return iiitCourses;
      case "nit": return nitCourses;
      default: return [];
    }
  };

  const fetchColleges = async (e) => {
    e.preventDefault();
    if (!instituteType || !gender || !category || !rank || selectedCourses.length === 0) {
      alert("Please select all fields and at least one course.");
      return;
    }

    try {
      const response = await axios.get(`http://localhost:5000/api/colleges/search`, {
        params: { instituteType, gender, category, rank: Number(rank), courses: selectedCourses.join(","), state }
      });
      setColleges(response.data);
    } catch (error) {
      console.error("Error fetching data:", error);
      alert(error.response?.data?.message || "Failed to fetch data. Please try again.");
    }
  };

  const handleCourseChange = (e) => {
    const value = e.target.value;
    if (selectedCourses.includes(value)) {
      setSelectedCourses(selectedCourses.filter(course => course !== value));
    } else if (selectedCourses.length < 3) {
      setSelectedCourses([...selectedCourses, value]);
    } else {
      alert("You can select a maximum of 3 courses.");
    }
  };

  return (
    <div>
      <h2>Find Your College</h2>
      <form onSubmit={fetchColleges}>
        <label>Institute Type:</label>
        <select value={instituteType} onChange={(e) => setInstituteType(e.target.value)}>
          <option value="">Select Institute Type</option>
          <option value="iit">IIT</option>
          <option value="iiit">IIIT</option>
          <option value="nit">NIT</option>
        </select>

        {instituteType === "nit" && (
          <>
            <label>State:</label>
            <select value={state} onChange={(e) => setState(e.target.value)}>
              <option value="">Select State</option>
              {indianStates.map(state => <option key={state} value={state}>{state}</option>)}
            </select>
          </>
        )}

        <label>Gender:</label>
        <select value={gender} onChange={(e) => setGender(e.target.value)}>
          <option value="">Select Gender</option>
          <option value="GENDER_NEUTRAL">Gender-Neutral</option>
          <option value="FEMALE_ONLY">Female</option>
        </select>

        <label>Category:</label>
        <select value={category} onChange={(e) => setCategory(e.target.value)}>
          <option value="">Select Category</option>
          <option value="OPEN">OPEN</option>
          <option value="EWS">EWS</option>
          <option value="OBC-NCL">OBC-NCL</option>
          <option value="SC">SC</option>
          <option value="ST">ST</option>
        </select>

        <label>Select Courses (up to 3):</label>
        <div className="course-selection">
          {getCourses().map((course) => (
            <div key={course} className={`course-box ${selectedCourses.includes(course) ? 'selected' : ''}`}>
              <input type="checkbox" value={course} checked={selectedCourses.includes(course)} onChange={handleCourseChange} />
              {course}
            </div>
          ))}
        </div>

        <label>Enter Your Rank:</label>
        <input type="number" value={rank} onChange={(e) => setRank(e.target.value)} placeholder="Enter your rank" required />

        <button type="submit">Search Colleges</button>
      </form>
    </div>
  );
};

export default RankForm;
